import Users from './Users'
import Blogs from './Blogs'

export default function InfoPanel({info}) {
  return (
    <div>
      {info === 'Users' ? <Users/> : null}
      {info === 'Blogs' ? <Blogs/> : null}
    </div>
  )
}
